export const setDivVisibility = (isVisible) => ({
    type: 'SET_DIV_VISIBILITY',
    payload: isVisible,
  });

export const login = () => ({
    type: 'LOGIN'
})

export const logout = () => {
  return {
    type: LOGOUT,
  };
};
